import React from "react";


const data = [
  {
      first_name : "Bill",
      last_name : "Evans",
      title : "Phone Rep",
      salary : "25,000"

  },
  {
      first_name : "Lee",
      last_name : "Morgan",
      title : "Phone Rep",
      salary : "27,000"

  },
  {
      first_name : "Esperanza",
      last_name : "Spaulding",
      title : "Phone Team Lead",
      salary : "32,000"

  },
  {
      first_name : "John",
      last_name : "Coltrane",
      title : "Call Center Supervisor",
      salary : "45,000"

  }
]

class Employees extends React.Component {


  render() {
    return (

      <table className="table-style">
        <thead>
          <tr className="table-row">
            <th>
              <button>First Name</button>
            </th>
            <th>
              <button>Last Name</button>
            </th>
            <th>
              <button>Title</button>
            </th>
            <th>
              <button>Salary</button>
            </th>
          </tr>
        </thead>
        <tbody>
          {
            this.props.map(row => (
              <tr>
                <td>{data.first_name}</td>
              </tr>
            ))
          }
        </tbody>
      </table>
    );
  }
}

export default Employees;
